/**
 * @param {string} s
 * @param {number} k
 * @return {number}
 */
var characterReplacement = function(s, k) {
    let maxLength = 0;
    let length = s.length;
    for (let i = 0; i < length; i++) {
        console.log(length, i, maxLength, s[i - 1], s[i])
        let tmpMax = 0;
        let acceptthreshold = k;
        
        for (let j = i; j < length; j++) {
            if(s[i] === s[j]) {
                tmpMax += 1;
            } else {
                if(acceptthreshold === 0) break;
                tmpMax += 1;
                acceptthreshold -= 1;
            }
        }

        for (let j = i-1; j >= 0; j--) {
            if(s[i] === s[j]) {
                tmpMax +=1
            } else {
                if(acceptthreshold === 0) break;
                tmpMax += 1;
                acceptthreshold -= 1;
            }
        }

        maxLength = Math.max(maxLength, tmpMax)
    }

    return maxLength;
};

